import React from 'react';


class Reset extends React.Component {
    clickreset = () => {
        console.log(this.props);
        this.setState({
            color: 'red', fontSize: 12
        })
    }
    render() {
        return (
            <>
                <button type="button" className="btn btn-primary btn-lg"
                    onClick={() => this.clickreset()}
                >reset</button>
            </>
        );
    }

}

export default Reset;
